const refresh = () => {};
    return (
        <div className="content">
            <Header/>
            <div className="main">
                <p><b>Create a task here!</b></p>
                <TaskHandling task={null} close={() => {}} refresh={refresh}/>
            </div>
            <Footer/>
        </div>
    );
};
